import React, {Component} from 'react';
import Contacts from '../components/Profile';

class App extends Component {
    render() {
        return (
            <Contacts contacts={this.state.contacts} />
        )
    }

    state = {
        customer: []
    };

    componentDidMount() {
        fetch('https://tasty-seahorse-5.loca.lt/api/accounts/customers/3/')
            .then(res => res.json())
            .then((data) => {
                this.setState({ contacts: data })
            })
            .catch(console.log)
    }
}

export default App;
